(5, 'SarymoniX', '2015-04-12 22:51:15', '<!--sizestart:4--><span style="font-size:14pt;"><!--/sizestart-->Тех.Работы<!--sizeend--></span><!--/sizeend--><br />Скоро мы будем с вами<br />С уважением VimeCraft.ru', '', '', 'Тех.работы на сайт', 'das', 'VimeCraft,уважением,будем,Скоро', '1', 'ads', 0, 1, 1, 1, 0, 1, '', '', ''),
(7, 'SarymoniX', '2015-04-22 18:26:49', '<!--fontstart:Arial Black--><span style="font-family:Arial Black"><!--/fontstart-->Всем доброго времени суток! <br />Вот и снова сайт в работе!<br />Изменения коснулись не только визуальной части сайта, но так же были частично переработаны некоторые компоненты, что позволило улучшить оптимизацию и как следствие скорость обработки страниц.<br />Небольшие изменения так же коснулись кода форума, что тоже должно в лучшую сторону сказаться на его производительности.<br /><br />Обо всех замеченных недостатках нового дизайна просим сообщать в теме этой новости на форуме.<!--fontend--></span><!--/fontend--><!--sizestart:2--><span style="font-size:10pt;"><!--/sizestart--><!--sizeend--></span><!--/sizeend-->', '<!--fontstart:Arial Black--><span style="font-family:Arial Black"><!--/fontstart--><!--sizestart:2--><span style="font-size:10pt;"><!--/sizestart-->Всем доброго времени суток! <br />Вот и снова сайт в работе!<br />Изменения коснулись не только визуальной части сайта, но так же были частично переработаны некоторые компоненты, что позволило улучшить оптимизацию и как следствие скорость обработки страниц.<br />Небольшие изменения так же коснулись кода форума, что тоже должно в лучшую сторону сказаться на его производительности.<br /><br />Обо всех замеченных недостатках нового дизайна просим сообщать в теме этой новости на форуме.<!--sizeend--></span><!--/sizeend--><!--fontend--></span><!--/fontend-->', '', 'Обновление сайта', 'Всем доброго времени суток!  Вот и снова сайт в работе! Изменения коснулись не только визуальной части сайта, но так же были частично переработаны некоторые компоненты, что позволило улучшит', 'коснулись,лучшую,сторону,сказаться,должно,форума,страниц,Небольшие,изменения,производительности,замеченных,сообщать,новости,форуме,просим,дизайна,недостатках,нового,обработки,следствие', '1', 'dsadasd', 0, 1, 1, 1, 0, 1, '', '', ''),
(8, 'SarymoniX', '2015-05-11 08:11:59', '<!--sizestart:3--><span style="font-size:12pt;"><!--/sizestart--><!--fontstart:Arial Black--><span style="font-family:Arial Black"><!--/fontstart-->чтобы узнать как получить призы за голосование жми  Подробнее<!--fontend--></span><!--/fontend--><!--sizeend--></span><!--/sizeend-->', 'Уважаемые игроки!<br />Теперь за каждый голос на наших топах вы получите рандомные предметы голосуйте каждый день и получайте подарки каждый день<br />1.Голосуйте за нас в топах<br />2.В игру ведите команду /cart all<br /><br />http://topcraft.ru/servers/4395<br />http://mcrate.su/rate/5017<br /><br />С уважением VimeCraft.ru', '', 'Голосуй и получи рандомные предметы', 'Уважаемые игроки! Теперь за каждый голос на наших топах Вы получите рандомные предметы Голосуйте каждый день и получайте подарки каждый день 1.Голосуйте за нас в топах 2.В игру ведите команд', 'каждый,топах,Голосуйте,topcraft,ведите,команду,servers,VimeCraft,уважением,mcrate,подарки,предметы,голос,Теперь,игроки,наших,получите,Уважаемые,рандомные,получайте', '1', 'golosuy-i-poluchi-randomnye-predmety', 9, 1, 1, 1, 0, 1, '', '', '');
