INSERT INTO `dle_static` (`id`, `name`, `descr`, `template`, `allow_br`, `allow_template`, `grouplevel`, `tpl`, `metadescr`, `metakeys`, `views`, `template_folder`, `date`, `metatitle`, `allow_count`, `sitemap`, `disable_index`) VALUES
(1, 'dle-rules-page', 'Общие правила на сайте', '<b>Общие правила поведения на сайте:</b><br /><br />Начнем с того, что на сайте общаются сотни людей, разных религий и взглядов, и все они являются полноправными посетителями нашего сайта, поэтому если мы хотим чтобы это сообщество людей функционировало нам и необходимы правила. Мы настоятельно рекомендуем прочитать настоящие правила, это займет у вас всего минут пять, но сбережет нам и вам время и поможет сделать сайт более интересным и организованным.<br /><br />Начнем с того, что на нашем сайте нужно вести себя уважительно ко всем посетителям сайта. Не надо оскорблений по отношению к участникам, это всегда лишнее. Если есть претензии - обращайтесь к Админам или Модераторам (воспользуйтесь личными сообщениями). Оскорбление других посетителей считается у нас одним из самых тяжких нарушений и строго наказывается администрацией. <b>У нас строго запрещен расизм, религиозные и политические высказывания.</b> Заранее благодарим вас за понимание и за желание сделать наш сайт более вежливым и дружелюбным.<br /><br /><b>На сайте строго запрещено:</b> <br /><br />- сообщения, не относящиеся к содержанию статьи или к контексту обсуждения<br />- оскорбление и угрозы в адрес посетителей сайта<br />- в комментариях запрещаются выражения, содержащие ненормативную лексику, унижающие человеческое достоинство, разжигающие межнациональную рознь<br />- спам, а также реклама любых товаров и услуг, иных ресурсов, СМИ или событий, не относящихся к контексту обсуждения статьи<br /><br />Давайте будем уважать друг друга и сайт, на который Вы и другие читатели приходят пообщаться и высказать свои мысли. Администрация сайта оставляет за собой право удалять комментарии или часть комментариев, если они не соответствуют данным требованиям.<br /><br />При нарушении правил вам может быть дано <b>предупреждение</b>. В некоторых случаях может быть дан бан <b>без предупреждений</b>. По вопросам снятия бана писать администратору.<br /><br /><b>Оскорбление</b> администраторов или модераторов также караются <b>баном</b> - уважайте чужой труд.<br /><br /><div align="center">{ACCEPT-DECLINE}</div>', 1, 1, 'all', '', 'Общие правила', 'Общие правила', 1112, '', 1428852288, '', 1, 1, 0),
(2, 'start', 'Быстрый старт', '<div class=\\"dpad\\">\r\n		<b><h2 class=\\"heading\\"><span id=\\"news-title\\"> </span></h2></b>\r\n		<div>\r\n	<div align=\\"center\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: \\''PT Sans\\'', Arial, Helvetica, sans-serif; font-size: 13px; font-stretch: inherit; line-height: normal; vertical-align: baseline; outline: none; color: rgb(102, 102, 102); word-spacing: 0px;\\">\r\n		<div class=\\"label1\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-size: 30px; font-stretch: inherit; line-height: 30px; vertical-align: baseline; outline: none; color: rgb(59, 59, 59);\\"><img src=\\"http://logo-craft.zapto.org/templates/logo/images/start.png\\" alt=\\"Как начать\\" title=\\"Как начать\\" style=\\"color: rgb(102, 102, 102); font-family: \\''Trebuchet MS\\'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17px; text-align: center; word-spacing: 0px; max-width: 630px;\\" /><br />\r\n			Всего 3 простых шага.</div>\r\n		<div class=\\"label2\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-size: 18px; font-stretch: inherit; vertical-align: baseline; outline: none; color: rgb(59, 59, 59);\\"><span class=\\"masha_index masha_index3\\" rel=\\"3\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span>Чтобы начать  на наших серверах.</div>\r\n		<div style=\\"margin: 0px; padding: 0px; font-family: \\''Trebuchet MS\\'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17px; word-spacing: 0px; text-align: center;\\"><br />\r\n			</div><img src=\\"http://zoomcraft.net/templates/zoomcraft/images/register_icon.png\\" alt=\\"Иконка\\" style=\\"margin: 0px; padding: 0px; border-width: 0px; font-size: 12.7272720336914px; font-stretch: inherit; vertical-align: baseline; outline: none;\\" /><br />\r\n		