(3, 'pravila', 'Правила', '<div id=\\"dle-content\\"><div class=\\"basecont\\"><br />	<div class=\\"dpad\\"><br />		<h2 class=\\"heading\\"><span id=\\"news-title\\">Общие правила на сайте</span></h2><br />		<h4>1. Общие правила</h4><ul class=\\"dots\\"><li><b>1.1</b> Не знание правил не освобождает вас от ответственности.</li><li><b>1.2</b> В правила в любой момент могут быть внесены изменения.</li><li><b>1.3</b> Начав играть на наших серверах, Вы автоматически подтверждаете своё согласие с данным сводом правил.</li><li><b>1.4</b> Администратор вправе наказать игрока по причине, не указанной в настоящих правилах.</li><li><b>1.5</b> Администрация не несет ответственности за временную или постоянную невозможность игры на сервере конкретным лицом или группой лиц.</li><li><b>1.6</b> Деньги потраченные на услуги сервера не возвращаются.</li><li><b>1.7</b> Запрещено выдавать себя за администрацию (у настоящих администраторов перед ником есть метка \\"<span class=\\"red\\">[А]</span>\\").<br /><span class=\\"red\\"><b>Наказание:</b> от 3-х дней бана.</span></li><li><b>1.8</b> Игроки обязаны выполнять требования Администрации и предписания данных правил.</li><li><b>1.9</b> Ответственность несет владелец аккаунта, независимо от того, кто совершал действия под данным аккаунтом.</li><li><b>1.10</b> Администрация оставляет за собой право удалять персонажей и постройки, которыми не пользовались более 30 дней.</li><li><b>1.11</b> Администрация ведет логи всех действий игроков на сервере и всех сообщений чата.</li><li><b>1.12</b> Администрация имеет право корректировать данный свод правил без уведомления игрока.</li></ul><br /><br /><h4>2. Аккаунт</h4><ul class=\\"dots\\"><li><b>2.1</b> Запрещены мультиаккаунты (регистрация 2-х и более аккаунтов одним лицом).</li><li><b>2.2</b> Ник должен быть корректным.</li><li><b>2.3</b> Ник не должен содержать мата, оскорблений и т.д.</li><li><b>2.4</b> Ник не должен состоять полностью из цифр.</li><li><b>2.5</b> Ник не должен быть короче 3 и длиннее 16 символов. </li><li><b>2.6</b> Запрещается регистрировать ники, схожие с никами других игроков.<br /><span class=\\"red\\"><b>Наказание:</b> блокировка навсегда аккаунта зарегистрированного позже.</span></li><li><b>2.7</b> Запрещается предоставлять свой аккаунт 3-м лицам <u>для игры на сервере</u>.<br /><span class=\\"red\\"><b>Наказание:</b> блокировка аккаунта навсегда.</span></li><li><b>2.8</b> Запрещена продажа аккаунтов.<br /><span class=\\"red\\"><b>Наказание:</b> перманентная блокировка аккаунта.</span></li></ul><br /><br /><h4>3. Общие правила поведения игроков на сервере</h4><ul class=\\"dots\\"><li><b>3.1</b> Запрещены любые способы <abbr class=\\"whelp hint\\" title=\\"Нанесение вреда чужому имуществу. Например: разрушение чужих построек, воровство предметов, затаптывание грядок, залив территории жидкостями, заполнение чужой территории сыпучими блоками.\\">гриферства</abbr>.<br /><span class=\\"red\\"><b>Наказание:</b> от 1 дня бана.</span></li><li><b>3.2</b> Запрещается уничтожать имущество в ответ на гриферство вашего имущества.</li><li><b>3.3</b> Запрещено мошенничество, намеренный обман игроков/администрации.<br /><span class=\\"red\\"><b>Наказание:</b> бан на сутки.</span></li><li><b>3.4</b> Запрещено обманывать игроков при торговле. (Для вашей же безопасности существует обменник на спауне.)</li><li><b>3.5</b> Запрещено убийство других игроков в <abbr class=\\"whelp hint\\" title=\\"Зона, где отключено PvP\\">NO-PvP зоне</abbr> (например, с помощью зелий).<br /><span class=\\"red\\"><b>Наказание:</b> 1 день бана.</span></li><li><b>3.6</b> Запрещены <abbr class=\\"whelp hint\\" title=\\"Безвозмездная передача ценных вещей другим игрокам в больших количествах. Целью проведения их обычно является нарушение игрового баланса.\\">раздачи вещей</abbr>.<br /><span class=\\"red\\"><b>Наказание:</b> бан навсегда организатора, участникам - от 3-х дней.</span></li><li><b>3.7</b> Администрация не возвращает вещи в следующих случаях:<br />- Удаление системой очистки дропа.<br />- Кража имущества с незаприваченной территории.<br />- Кража имущества игроками, состоящими в привате.<br />- Вайп или откат карты.<br />- Различные баги игры, произошедшие не по вине администрации.<br /></li><li><b>3.8</b> Администрация не осуществляет вам помощь в виде ускорения постройки здания, выдачи предметов, ресурсов и др.</li><li><b>3.9</b> Запрещено что-либо выпрашивать у администрации (права, ресурсы, игровые деньги, разбан и т.д.)<br /><span class=\\"red\\"><b>Наказание:</b> от 1 дня бана.</span></li><li><b>3.10</b> Запрещено продавать игровые предметы за реальные деньги.<br /><span class=\\"red\\"><b>Наказание:</b> от 1 дня бана.</span></li><li><b>3.11</b> Игрок не имеет права пользоваться сторонними программами, скриптами, модами и т.п. для облегчения или изменения игрового процесса (читы). Игрок не имеет права пользоваться багами/дюпами/недочетами игры, а также распространять информацию о них. При обнаружении обязан сообщить администратору или модератору (через систему личных сообщений).<br /><span class=\\"red\\"><b>Наказание:</b> бан навсегда.</span></li><li><b>3.12</b> Запрещено оскорбление и троллинг игроков. <br /><span class=\\"red\\"><b>Наказание:</b> кик/мут/бан на усмотрение модератора.</span></li><li><b>3.13</b> Администратор вправе изъять у вас любое имущество, если Вы не сможете доказать его происхождение.</li><li><b>3.16</b> Вызывание неполадок в работе сервера или попытки обрушить сервер, путем специально вызванных лагов или подобного, влекут за собой глобальный бан.</li><li><b>3.17</b> Запрещено подстрекать третьих лиц на нарушение правил.<br /><span class=\\"red\\"><b>Наказание:</b> от 3-х дней бана.</span></li><li><b>3.18</b> Запрещается ставить неприличные скины и плащи: Адам, Ева, Гитлер и т.п.<br /><span class=\\"red\\"><b>Наказание:</b> отключение возможности устанавливать скин.</span></li><li><b>3.19</b> Запрещается использовать <u>распылитель пены</u> для залива чужой или общественной (незаприваченной) территории пеной.<br /><span class=\\"red\\"><b>Наказание:</b> Бан от 12 часов.</span></li><li><b>3.20</b> В случае отказа от обмена, Вы обязаны вернуть полученные вещи (и участник обмена тоже).</li><li><b>3.21</b> Запрещается ставить публичные варпы и точки домов в опасных для игроков местах (как правило, это - ловушки целью которых является убийство игроков).<br /><span class=\\"red\\"><b>Наказание:</b> 3 дня бана.</span></li></ul><br /><br /><h4>4. Постройки</h4><ul class=\\"dots\\"><li><b>4.1</b> Запрещены бессмысленные постройки (столбы в небо, глубокие ямы, случайно наставленные блоки, коробки без окон и дверей, и т.д.)<br /><span class=\\"red\\"><b>Наказание:</b> снос постройки (также возможен бан на усмотрение модератора).</span></li><li><b>4.2</b> Незаконченные постройки без таблички с вашим никнеймом и метки \\"строится\\" считаются заброшенными и могут подлежать сносу администрацией.</li><li><b>4.3</b> Запрещены постройки создающие лаги и замедляющие работу сервера.<br /><span class=\\"red\\"><b>Наказание:</b> от 1 дня бана + снос постройки.</span></li><li><b>4.4</b> Приватить личную территорию необходимо путем создания имени региона равным вашему игровому нику. Пример: SpireX, Регионы: SpireX-Home, SpireX-Garden, SpireX-Lab. Регионы с бессмысленными названиями могут быть сняты администрацией (за потерянные вещи администрация ответственности не несёт).</li><li><b>4.5</b> Администрация вправе снять приват территории, если на нём нет никаких построек.</li><li><b>4.6</b> При отсутствии игрока на сервере более 30 дней все его приваты автоматически снимаются.</li><li><b>4.7</b> Постройки оставленные за зоной привата будут доступны для других игроков. Администрация не несет ответственность за потерю имущества.</li><li><b>4.8</b> Вся незаприваченная территория попавшая под приват другого игрока становится его собственностью.</li><li><b>4.9</b> Игрок должен покинуть чужую территорию по просьбе ее хозяина.</li><li><b>4.10</b> Запрещено ставить точки дома/варпы на чужой территории без согласия владельца.<br /><span class=\\"red\\"><b>Наказание:</b> 12 часов бана + удаление точки.</span></li><li><b>4.11</b> Запрещено строить ловушки для других игроков за пределами своего привата.<br /><span class=\\"red\\"><b>Наказание:</b> 1 день бана.</span></li><li><b>4.12</b> Запрещено приватить территорию над постройками других игроков (не распространяется на подземные постройки, которые не видно на поверхности).<br /><span class=\\"red\\"><b>Наказание:</b> снос постройки.</span></li><li><b>4.13</b> Запрещена блокировка доступа к чужим сооружениям.<br /> <span class=\\"red\\"><b>Наказание:</b> 1 день бана.</span></li><li><b>4.14</b> Запрещены бессмысленные постройки в воздухе. бан 1 день. <br /><span class=\\"red\\"><b>Наказание:</b> 1 день бана.</span></li><li><b>4.15</b> Запрещено перегружать чанк различными механизмами/сущностями (скот, вагонетки). <br /><span class=\\"red\\"><b>Наказание:</b> 1 день бана + снос всех механизмов.</span></li><li><b>4.16</b> Запрещено использовать блоки машин (те, которые состоят из нескольких блоков) RailCraft/Forestry в декоративных целях. Это создаёт нагрузку на сервер. <i>Коксовый и пламенный кирпич - это декоративные блоки. Вы смело можете использовать их.</i><br /><span class=\\"red\\"><b>Наказание:</b> 1 день бана + снос всех блоков.</span></li><li><b>4.17</b> Запрещено перекрывать выходы из порталов. Такие порталы становятся ловушкой для других игроков. Хотя бы с одной из сторон должен быть отступ, позволяющий выйти из портала.<br /><span class=\\"red\\"><b>Наказание:</b> 1 день бана.</span></li><li><b>4.18</b> Запрещено использование различных механизмов для прогрузки чанков (например, использовать карьер не по назначению).</span></li><li><b>4.19</b> Игроки обязаны закрывать ямы большой площади, выкопанные карьером, либо размещайте карьер в океане. В этом случае заделывать яму необязательно. (Для их заделывания рекомендуется использовать заполнитель).</span></li><li><b>4.20</b> Запрещена установка избыточного количества солнечных панелей (HiTech сервера). Допускается установка не более 128 панелей различных видов в сумме на 1 приват. (Приваты, расположенные рядом и имеющие одинаковый список участников/владельцев считаются все вместе за 1 большой приват).<br /><span class=\\"red\\"><b>Наказание:</b> снос постройки.</span></span></li><li><b>4.21</b> Запрещается укреплять чужие здания.<br /><span class=\\"red\\"><b>Наказание:</b> блокировка аккаунта навсегда.</span></li></ul><br /><br /><h4>5. Общение в чате</h4><ul class=\\"dots\\"><li><b>5.1</b> Пишите грамотно на своем языке.</li><li><b>5.2</b> Игрок не имеет право материться (завуалированный мат), оскорблять кого-либо, унижать честь и достоинство, ущемлять в правах игроков и т.п. </li><li><b>5.3</b> Игрок не имеет право оскорблять, критиковать администрацию проекта.</li><li><b>5.4</b> Запрещён спам</li><li><b>5.5</b> Запрещёно написание сообщения заглавными буквами (капс).</li><li><b>5.6</b> Запрещено разглашать ложную информацию.</li><li><b>5.7</b> Флуд и сообщения, не имеющие смысла, в больших количествах запрещены. </li><li><b>5.8</b> Запрещены выражения, унижающие человеческое достоинство, дискриминирующие или разжигающие межнациональную рознь.</li><li><b>5.9</b> Запрещено просить игроков выйти из игры когда все слоты заполнены.</li><li><b>5.10</b> Запрещено коверкать слова с целью обхода антимат системы чата.<br /><span class=\\"red\\"><b>Наказание:</b> бан от 1 дня</span></li><li><b>5.11</b> Обсуждение политики запрещено.<br /><span class=\\"red\\"><b>Наказание:</b> бан от 3 дней</span><i>Мы не хотим, чтобы игроки становились врагами из-за политики тех или иных стран. Давайте жить дружно (с)</i></li><li><b>Данные пункты правил распространяются также на личные сообщения и надписи на табличках.</b><br /><span class=\\"red\\"><b>Наказание:</b> мут / кик / от 12 часов бана (выбирается в зависимости от нарушения).</span></li></ul><br /><br /><h4>6. Платные услуги</h4><ul class=\\"dots\\"><li><b>7.1</b> Оплаченные покупки возврату не подлежат.</li><li><b>7.2</b> Попытки махинаций оплатами, или ввод Администрации в заблуждение наказываются баном без возврата средств.</li><li><b>7.3</b> Администрация имеет полное право на отказ в предоставление услуг по причинам: неадекватность, требование несуществующих услуг, наглеж, оскорбления, и т.д. </li><li><b>7.4</b> Администрация не возвращает купленные вещи, которые были потеряны в результате убийства или удалены системой очистки дропа.</li></ul><br /><br /><h4>8. Права и обязанности модератора</h4><ul class=\\"dots\\"><li><b>8.1</b> Модератор обязан быть общительным, грамотным, воспитанным и толерантным по отношению ко всем игрокам сервера.</li><li><b>8.2</b> Модератор обязан соблюдать цензуру и речевые нормы при общении с игроками .</li><li><b>8.3</b> При выдаче бана модератору желательно делать скриншоты или видео нарушения игрока (на случай разбирательства).</li><li><b>8.4</b> Модератор обязан уметь давать отчет своим действиям любому из членов администрации.</li><li><b>8.5</b> Модератор обязан контролировать игровой процесс и вовремя предотвращать различные инциденты, которые могут повлечь за собой нарушение всего свода правил сервера.</li><li><b>8.6</b> Модератор обязан указывать сноску на соответствующий пункт данных правил при их исполнении.</li><li><b>8.7</b> Модератор обязан исполнять указания администрации вовремя.</li><li><b>8.8</b> Модератор не имеет права злоупотреблять своими правами в пользу себя, друзей или третьих лиц.</li><li><b>8.9</b> Модератор, не поняв ситуации, должен обратиться к администратору, чтобы тот помог.</li><li><b>8.10</b> Модератор не имеет права блокировать/мешать/телепортировать/кикать и т.д. игрока без серьезной причины.</li><li><b>8.11</b> Модератор может быть снят с поста модератора, если он отсутствовал не по уважительной причине более 2-x недель.</li><li><b>8.12</b> Модератор обязан рассматривать все жалобы игроков касательно серверов, которые он модерирует.</li><li><b>8.13</b> Модератор обязан следить за своим аккаунтом и вовремя предотвращать к нему доступ 3-х лиц. В случае выявления подобного модератор будет лишён своего статуса без возможности апелляции.</li></ul><br /><br /><i><ul class=\\"dots\\"><li><b>Дюп</b> - это копирование вещей с помощью багов игрового сервера.</li><li><b>Обменом</b> является передача игровых ресурсов (предметов) между двумя и более игроками.</li><li>Под <b>администрацией</b> подразумеваются только администраторы.</li><li><b>Гриферство</b> - это нанесение вреда <u>чужому имуществу</u> (постройки). К гриферству относится: залив жидкостями, разрушение построек, заполнение территории сыпучими блокам, затаптывание грядок, убийство мобов, размещение блоков затрудняющих доступ, кража вещей. Обман, ловушки, убийство гриферством не является.</li></ul></i><br />		<br clear=\\"all\\" /><br />		<div class=\\"storenumber\\"></div><br />	</div><br /></div></div>', 1, 1, 'all', '', 'авы', 'Наказание,Запрещено,игроков,Модератор,постройки,Администрация,обязан,имеет,правил,Запрещается,сервера,Запрещены,должен,более,других,игрока,блокировка,навсегда,администрации,территории', 2372, '', 1428858390, '', 1, 1, 0),
(4, 'security', 'Безопасность аккаунта', 'выф', 2, 1, 'all', 'security', 'выф', '', 163, '', 1428858412, '', 1, 1, 0),
(5, 'commands', 'Команды сервера', 'выф', 2, 1, 'all', 'commands', 'выф', '', 199, '', 1428868884, '', 1, 1, 0),
(6, 'hitech', 'Сервер HiTech', 'dsa', 2, 1, 'all', 'hitech', 'dsa', '', 620, '', 1428868953, '', 1, 1, 0);
INSERT INTO `dle_static` (`id`, `name`, `descr`, `template`, `allow_br`, `allow_template`, `grouplevel`, `tpl`, `metadescr`, `metakeys`, `views`, `template_folder`, `date`, `metatitle`, `allow_count`, `sitemap`, `disable_index`) VALUES
(7, 'donat', 'Донат VimeCraft', '<div class=\\"blockquote\\" style=\\"padding-left: 15px; border-left-width: 5px; border-left-style: solid; border-left-color: red; font-size: 16px; line-height: 22px; color: rgb(62, 85, 72); font-family: segoeui; word-spacing: 0px;\\">\r\n		<h3><span class=\\"masha_index masha_index2\\" rel=\\"2\\"></span>Зачем это нужно?&nbsp;<img src=\\"http://simpleminecraft.ru/uploads/posts/2014-12/1417786370_1340281402_donate.png\\" style=\\"width: 30px;\\"></h3><span class=\\"masha_index masha_index3\\" rel=\\"3\\"></span><span class=\\"masha_index masha_index3\\" rel=\\"3\\"></span>Каждому онлайн проекту требуется поддержка на развитие от пользователей. Нам необходимо улучшать и оплачивать серверное оборудование, чтобы Вам и вашим друзьям было комфортно у нас играть. А также мы рекламируем наш проект, что требует не маленьких денежных затрат. В связи с этим всем мы вводим систему пожертвований. Мы очень сильно надеемся на Вас, что Вы поддержите наш проект.</div><br>\r\n\r\n<a href=\\"http://vimecraft.ru/donate.html\\" style=\\"color: rgb(104, 132, 13);\\">\r\n			<center><button type=\\"submit\\" name=\\"submit\\" class=\\"buttonred\\" style=\\"-webkit-transition: 200ms; transition: 200ms; text-shadow: rgb(192, 57, 43) 0px 1px 0px; border-radius: 4px; font-weight: bold; cursor: pointer; border-style: none none solid; border-bottom-color: rgb(192, 57, 43); padding: 5px 10px; color: rgb(232, 239, 247); background: 0px -12px rgb(231, 76, 60);\\"><span class=\\"masha_index masha_index4\\" rel=\\"4\\"></span><span class=\\"masha_index masha_index4\\" rel=\\"4\\"></span>Сделать пожертвование на развитие проекта</button></a><center><br><br>\r\n\r\n<div class=\\"blockquote\\" style=\\"padding-left: 15px; border-left-width: 5px; border-left-style: solid; border-left-color: rgb(185, 30, 233); font-size: 16px; line-height: 22px; color: rgb(62, 85, 72); font-family: segoeui; word-spacing: 0px;\\"><span style=\\"word-spacing: 1.10000002384186px;\\"><span class=\\"masha_index masha_index6\\" rel=\\"6\\"></span>Огромное спасибо тем людям которые сделали вклад в развитие проекта!</span><br>\r\n		</div><br>\r\n\r\n\r\n<div class=\\"blockquote\\" style=\\"margin: 0px; padding: 0px 0px 0px 15px; border-width: 0px 0px 0px 5px; border-left-style: solid; border-left-color: rgb(85, 190, 52); font-family: segoeui; font-size: 16px; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: 22px; vertical-align: baseline; outline: none; color: rgb(62, 85, 72);\\">\r\n						<h3 style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"><span class=\\"masha_index masha_index8\\" rel=\\"8\\"></span>Пакет услуги: VIP</h3><small style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"><span class=\\"masha_index masha_index51\\" rel=\\"51\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index39\\" rel=\\"39\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index52\\" rel=\\"52\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index9\\" rel=\\"9\\"></span>Стоимость услуги в месяц: 100 рублей</small><br style=\\"outline: none;\\">\r\n						<small style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"><span class=\\"masha_index masha_index52\\" rel=\\"52\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index40\\" rel=\\"40\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index53\\" rel=\\"53\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index10\\" rel=\\"10\\"></span>В услугу входят возможности:</small>&nbsp;</div>\r\n\r\n\r\n<div class=\\"blockquote\\" style=\\"padding-left: 15px; border-left-width: 5px; border-left-style: solid; border-left-color: rgb(85, 190, 52); font-size: 16px; line-height: 22px; color: rgb(62, 85, 72); font-family: segoeui; word-spacing: 0px;\\"><img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index11\\" rel=\\"11\\"></span><span class=\\"masha_index masha_index11\\" rel=\\"11\\"></span>Создание приватных зон на серверах:&nbsp;<b>2 зоны по 200 тысяч кубов</b>&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index13\\" rel=\\"13\\"></span><span class=\\"masha_index masha_index13\\" rel=\\"13\\"></span>Возможность войти на полный&nbsp;<b>сервер</b><br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index13\\" rel=\\"13\\"></span><span class=\\"masha_index masha_index13\\" rel=\\"13\\"></span>Возможность включить режим полета командой&nbsp;<b>/fly</b><br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index38\\" rel=\\"38\\"></span><span class=\\"masha_index masha_index29\\" rel=\\"29\\"></span>Возможность открыть верстак в любом месте командой&nbsp;<b>/workebench</b><br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index15\\" rel=\\"15\\"></span>Возможность исцелить себя командой&nbsp;<b>/heal</b>&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index58\\" rel=\\"58\\"></span><span class=\\"masha_index masha_index46\\" rel=\\"46\\"></span>Возможность писать разными цветами в чат:&nbsp;<b>&amp;</b>[<a href=\\"cveta.html\\" style=\\"color: rgb(104, 132, 13);\\">код цвета</a>]&nbsp;<b>сообщение</b>&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index23\\" rel=\\"23\\"></span><span class=\\"masha_index masha_index21\\" rel=\\"21\\"></span>Возможность получать пакет ресурсов&nbsp;<a href=\\"vip.html\\" style=\\"color: rgb(104, 132, 13);\\">VIP</a>&nbsp;командой&nbsp;<b>/kit vip</b>&nbsp;(10 раз в 30 дней)&nbsp;<br>\r\n		</div><br>\r\n\r\n\r\n<a href=\\"http://vimecraft.ru/donate.html\\" style=\\"color: rgb(104, 132, 13);\\">\r\n			<button type=\\"submit\\" name=\\"submit\\" class=\\"buttongo\\" style=\\"-webkit-transition: 200ms; transition: 200ms; text-shadow: rgb(52, 152, 219) 0px 1px 0px; border-radius: 4px; font-weight: bold; cursor: pointer; border-style: none none solid; border-bottom-color: rgb(52, 152, 219); padding: 5px 10px; color: rgb(232, 239, 247); background: 0px -12px rgb(82, 179, 217);\\"><span class=\\"masha_index masha_index26\\" rel=\\"26\\"></span><span class=\\"masha_index masha_index22\\" rel=\\"22\\"></span>Приобрести услугу: ВИП , за 100 рублей на месяц</button></a><br><br>\r\n\r\n\r\n<div class=\\"blockquote\\" style=\\"margin: 0px; padding: 0px 0px 0px 15px; border-width: 0px 0px 0px 5px; border-left-style: solid; border-left-color: rgb(85, 190, 52); font-family: segoeui; font-size: 16px; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: 22px; vertical-align: baseline; outline: none; color: rgb(62, 85, 72);\\">\r\n				<h3 style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"><span class=\\"masha_index masha_index23\\" rel=\\"23\\"></span>Пакет услуги: Премиум</h3><small style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"><span class=\\"masha_index masha_index51\\" rel=\\"51\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index39\\" rel=\\"39\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></span><span class=\\"masha_index masha_index52\\" rel=\\"52\\" style=\\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: none;\\"></s