		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index17\\" rel=\\"17\\"></span>Возможность запустить изменять время в игре&nbsp;<b>/time set [day][night]</b>&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index42\\" rel=\\"42\\"></span><span class=\\"masha_index masha_index33\\" rel=\\"33\\"></span>Возможность Создание 3 своих варпов командой&nbsp;<b>/setwarp [название]</b>&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index58\\" rel=\\"58\\"></span><span class=\\"masha_index masha_index46\\" rel=\\"46\\"></span>Возможность писать разными цветами в чат:&nbsp;<b>&amp;</b>[<a href=\\"cveta.html\\" style=\\"color: rgb(104, 132, 13);\\">код цвета</a>]&nbsp;<b>сообщение</b>&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index23\\" rel=\\"23\\"></span><span class=\\"masha_index masha_index21\\" rel=\\"21\\"></span>Возможность получать пакет ресурсов&nbsp;<a href=\\"deluxe.html\\" style=\\"color: rgb(104, 132, 13);\\">Deluxe</a>&nbsp;командой&nbsp;<b>/kit deluxe</b>&nbsp;(10 раз в 30 дней)&nbsp;<br>\r\n		<img src=\\"http://simpleminecraft.ru/uploads/img/ok.png\\"><span class=\\"masha_index masha_index44\\" rel=\\"44\\"></span><span class=\\"masha_index masha_index35\\" rel=\\"35\\"></span>Возможность сменить скин HD+Плаш <span style=\\"color: rgb(62, 85, 72); font-family: segoeui; font-size: 16px; line-height: 22px; word-spacing: 0px; font-weight: bold;\\">(Попросить админа)</span></div><br>\r\n\r\n\r\n<a href=\\"http://vimecraft.ru/donate.html\\" style=\\"color: rgb(104, 132, 13);\\">\r\n			<button type=\\"submit\\" name=\\"submit\\" class=\\"buttongo\\" style=\\"-webkit-transition: 200ms; transition: 200ms; text-shadow: rgb(52, 152, 219) 0px 1px 0px; border-radius: 4px; font-weight: bold; cursor: pointer; border-style: none none solid; border-bottom-color: rgb(52, 152, 219); padding: 5px 10px; color: rgb(232, 239, 247); background: 0px -12px rgb(82, 179, 217);\\"><span class=\\"masha_index masha_index69\\" rel=\\"69\\"></span><span class=\\"masha_index masha_index50\\" rel=\\"50\\"></span>Приобрести услугу: Делюкс, за 600 рублей на месяц</button></a>', 2, 1, 'all', '', 'fs', 'Возможность,командой,режим,открыть,любом,Создание,месяц,рублей,услугу,услуги,месте,который,голову,одеть,запустить,кубов,тысяч,приватных,ресурсов,серверах', 3683, '', 1429553310, '', 1, 1, 0),
